import React from 'react';
import Header from '../components/header/Header';
import WalletConnect from '../components/layouts/WalletConnect';
import Footer from '../components/footer/Footer';

const ConnectWallet = () => {
  return <div>
    <Header />
    <WalletConnect />
    <Footer />
  </div>;
};

export default ConnectWallet;
